import React from 'react';
import Navbar from '../../components/Navbar/Navbar';
import content from "../../content.json";
import icon from "../../assets/images/"
const Dashboard = ()=>{
    console.log(content)
    const {Cards=[]} = content;
    return(
        <React.Fragment>
            {Cards && Cards.map((card)=>{
                return(
                    <div className='cards'>
                        <h3>{card.name}</h3>
                        <img src={require()}/>
                    </div>
                )

            })}
        </React.Fragment>
    )

};
export default Dashboard;
